import React, { Component } from 'react';
import './index.css';

import Icons from './components/Icons/IconContainer';


export default 
class App extends Component {
  state = {
    pomodoro: false
  }

  render() {
    return (
      <div 
        style = { defaultStyle }
      >

        <Icons />
      </div>
    );
  }
}

const defaultStyle = {
  height: '100vh',
  width: '100vw',
  background: 'linear-gradient(#090a0a, #151617 45%)',
  color: 'white'
}
